import React, { useState } from "react";
import NavBar from "./NavBar";
import LocationImage from "./LocationImage";

function StartGame() {
  const [locationImage, setLocationImage] = useState("")
  const locationImages = {
    starting_path: "assets/starting_path.JPG",
    portal: "assets/portal.jpeg",
    spooky1: "assets/spooky1.jpg",
    spooky2: "assets/spooky2.jpg",
    swamp1: "assets/swamp1.jpg",
    swamp_village: "assets/swamp_village.jpg",
    fork: "assets/fork.jpg",
    cave: "assets/cave.jpeg",
    waterfall_village: "assets/waterfall_village.jpg",
    stairs: "assets/stairs.png",
    tree_village: "assets/tree_village.jpg",
    shop: "assets/shop.jpeg",
  }

  return (
    <>
      <NavBar/>
      <div className="row"> {/* make this add to 12 */}
        <div className="col-6"><LocationImage locationImage={locationImage}/></div>
        <div className="col-6"></div>
        {/* <div className="col-2"></div> */}
      </div>
    </>
  )
}

export default StartGame
